Text:
@permet09
I ***ALWAYS*** run my first intallations and relative patches or keygens in Sandoxie, and only after seeing them do what's expected without strange things I use them in the "real" world.
The Patch doesn't do anything else than patching the program, and my AV also don't complain with it, so I use it without fear. Actually, only minor AVs complain with it, and many of them detect it as an HackTool.Patch (what else?) or for being packed with AsPack. A typical case of false positive...
